import React from 'react';
import Button from '../UI/Button/Button';
const EndPage = (props) => {
    const backMainMenuHandler = () => {
        console.log(props);
        props.history.push('/');
    }
    return(
        <div>
            <h4>Thank You</h4>
            <Button btnType="Danger" clicked={backMainMenuHandler}>RETURN TO MAIN MENU</Button>
            </div>
    )
}
export default EndPage;
